css:
@-moz-document domain("inside.tensor.ru") {
.navigation-LeftNavigation__icon{opacity:.4;transition: opacity .4s linear;}
.navigation-LeftNavigation__item:hover .navigation-LeftNavigation__icon{opacity:.9;transition: opacity .8s linear;}
[title="Моя страница"]{opacity:1;}
.compact-menu .navigation-LeftNavigation__icon{opacity:1;}
#sideRight tr{opacity:.4; transition: opacity .8s linear;}
#sideRight tr:hover{opacity:1; transition: opacity .4s ease-in-out;}
*{transition: background-color .5s ease-in-out, border-radius .5s ease-in-out, display .4s linear, color .6s ease-in-out, border-color 1s ease-in;}
*:hover{transition: background-color .2s ease-in-out, border-radius .2s ease-in-out, display .4s linear, color .4s ease-in-out, border-color .6s ease-in;}
.employee-EventItem_Component:hover .employee-EventItem-msg{opacity:0.9;transition: opacity .4s ease-in-out;transition-delay:.2s;}
.employee-EventItem_Component .employee-EventItem-msg{opacity:0;transition: opacity .3s ease-in-out;display:block;}
.ws-field-button.ws-button-classic.sbisname-window-title-close.ws-enabled{transition: background 0s;}
.ws-field-button.ws-button-classic.sbisname-window-title-close.ws-enabled:hover{transition: background 0s;}
.ws-filter-button-block,.ws-filter-button-block:hover{transition: background 0s;}
.ws-field *,.ws-field:hover *{transition: background 0s;}
.listEmpl-row-options-container{opacity:0;display:inline!important;transition:opacity .6s ease-in-out;}
.ws-treeview-employees .ws-browser-table-row:hover .listEmpl-row-options-container{opacity:1;transition:opacity .4s ease-in-out;}
[category*="Отдыхаем"],[category*="Люди"]{opacity:.3;transition: opacity .4s ease-in;}
[category*="Отдыхаем"]:hover,[category*="Люди"]:hover{opacity:1;transition: opacity .6s ease-in;}
.event-block-body{opacity:.8;transition:opacity .4s ease-in;}
.event-block-body:hover{opacity:1;transition:opacity .4s ease-in;}
#aboutList ul li a.how_easy_run, #aboutListInvert ul li a.how_easy_run{display:inline;opacity:0;transition:opacity .3s ease-in;}
#aboutList ul li:hover a.how_easy_run, #aboutListInvert ul li:hover a.how_easy_run{opacity:1;transition:opacity .6s ease-in;}
.listEmpl-phone-text{font-weight:bolder;background-color:#FFF;padding:0 .5em;}
.icon-16.icon-Phone.icon-disabled.listEmpl-phone-icon-align-bottom{background-color:#FFF;}
img[src*='Kartinki/u384_normal']{border:1px outset #ff7030; border-radius:50%;}
img[src*='kontakty_u866']{border:1px solid #999; border-radius:50%;}
.listEmpl-photo-wrapper>.photo-employee {border:2px solid #ccc;}
.employee_online_indicator+.photo-employee {border:1px outset #f80;}
.employee_online_indicator+.photo-employee:hover{border-color:#d60;border-style:solid;}
.listEmpl-phone{position:absolute;right:0;background-color:#FFF;}
.events_tape_td{perspective: 1500px;}
#sideRight td.ws-browser-cell{perspective:200px;}
#sideRight tr:nth-child(odd) td.ws-browser-cell>div{transform:translate3d(0px,0px,-15px) rotateY(10deg);transition:transform .6s ease-in;transition-delay:1s;}
#sideRight tr:nth-child(even) td.ws-browser-cell>div{transform:translate3d(0px,0px,-15px) rotateY(-10deg);transition:transform .6s ease-in;transition-delay:1s;}
#sideRight tr td.ws-browser-cell>div:hover{transform:translate3d(0px,0px,0px) rotateY(0deg);transition:transform .6s ease-in;}
.events_tape_td>div{transform:translate3d(0px,0px,-17px) rotateX(-3deg);transition:transform 1.2s cubic-bezier(.48,-0.96,.37,1.68);display:block;transform-style: preserve-3d;transition-delay:.6s;}
.events_tape_td>div:hover{transform:translate3d(0,0,0) rotateX(0);transition:transform .8s cubic-bezier(.34,.77,.24,1.01);}
.socnet_answer_wc{display:inline; opacity:0;transition:opacity .4s ease-in;}
.sn-EventBlock__Comment:hover .socnet_answer_wc{opacity:1;transition:opacity .4s ease-in;}
.sn-EventBlock__Comment .like_count_null .wall-Likes{display:block;opacity:0;transition:opacity .4s ease-in;}
.sn-EventBlock__Comment:hover .wall-Likes{opacity:1;transition:opacity .4s ease-in;}
.news-PreprocessorNews-main_page td{perspective: 1500px;}
.news-PreprocessorNews-main_page tr td>div{transition:transform .8s ease-in;}
.news-PreprocessorNews-main_page tr td:hover>div{transform:translate3d(0px,0px,0px) rotateX(0deg); transition:transform .4s ease-in;}
.news-PreprocessorNews-main_page tr td>div{transform:translate3d(0px,12px,-50px) rotateX(+15deg);}
.news-PreprocessorNews-main_page tr+tr td>div{transform:translate3d(0px,6px,-17px) rotateX(+8deg);}
.news-PreprocessorNews-main_page tr+tr+tr td>div{transform:translate3d(0px,3px,-6px) rotateX(+4deg);}
.news-PreprocessorNews-main_page tr+tr+tr+tr td>div{transform:translate3d(0px,0px,0px) rotateX(0);}
.news-PreprocessorNews-main_page tr+tr+tr+tr+tr td>div{transform:translate3d(0px,-5px,-10px) rotateX(-10deg);}
.news-PreprocessorNews-main_page tr+tr+tr+tr+tr+tr td>div{transform:translate3d(0px,-10px,-30px) rotateX(-30deg);}
.news-PreprocessorNews-main_page tr+tr+tr+tr+tr+tr+tr td>div{transform:translate3d(0px,-15px,-150px) rotateX(-45deg);}
.icon-Profile[title="Работаю"]:before {content: ""; display:inline-block;height:10px;width:10px;background-image:url('data:image/png;base64,');}
#sideRight{background-image:url(data:image/jpeg;base64,);}
.employee_online_indicator{background-image:url('data:image/png;base64,');}
}
